import { useState } from 'react';
import { NavLink } from 'react-router-dom';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import SwipeableDrawer from '@material-ui/core/SwipeableDrawer';
import Box from '@material-ui/core/Box';
import Divider from '@material-ui/core/Divider';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import List from '@material-ui/core/List';
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles({
    list: {
        width: 250,
    },
});

function Drawer() {
    const classes = useStyles();
    const [open, setOpen] = useState(false);

    return (
        <>
            <IconButton
                edge="start"
                color="inherit"
                aria-label="open drawer"
                onClick={() => setOpen(true)}
            >
                <MenuIcon />
            </IconButton>

            <SwipeableDrawer
                anchor="left"
                open={open}
                onClose={() => setOpen(false)}
                onOpen={() => setOpen(true)}>
                <div className={classes.list}>
                    <Box textAlign="center" p={2}>
                        SW WIKI
                    </Box>
                    <Divider />
                    <List>
                        <NavLink to="/" exact style={ {textDecoration: 'none', color: 'inherit'} }>
                        <ListItem button onClick={() => { }}>
                            <ListItemText primary={'Home'}> </ListItemText>
                        </ListItem>
                        </NavLink>

                        <NavLink to="/people/?page=1" exact style={ {textDecoration: 'none', color: 'inherit'} }>
                        <ListItem button onClick={() => { }}>
                             <ListItemText primary={'Characters'}> </ListItemText>
                        </ListItem>
                        </NavLink>

                        <ListItem to="/planets/?page=1" exact button onClick={() => { }}>
                            <ListItemText primary={'Planets'}> </ListItemText>
                        </ListItem>
                        <ListItem to="/species/?page=1" exact button onClick={() => { }}>
                            <ListItemText primary={'Species'}> </ListItemText>
                        </ListItem>
                    </List>
                </div>
            </SwipeableDrawer>
        </>
    );
}


export default Drawer;
